(12, 'eruyar123@gmail.com', '2021-10-23 01:33:00', 'eruyar123@gmail.com', '2021-10-23 01:35:09', '23-10-2021', 'TFF 1. Lig\'in 10. hafta karşılaşmasında Ankaragücü sahasında Manisa FK\'yı konuk etti. Mücadele 2-1 ev sahibi ekibin üstünlüğüyle sonuçlandı.\n\nAnkaragücü\'ne galibiyeti getiren golleri 29. dakikada Ariyibi ve 40\'ta Mehmet Uçar kaydetti. Manisa\'nın tek golü ise 67. dakikada Guevin Tormin\'den geldi. Ayrıca Başkent temsilcisinde Sinan Osmanoğlu 54. dakikada direkt kırmızı kart görerek takımını 10 kişi bıraktı.\n\nBu sonuçla birlikte Ankaragücü 10 haftada 7 galibiyet, 3 beraberlik alarak 24 puana yükseldi. Manisa FK ise 9 puanda kaldı ve galibiyet hasreti 7 maça çıktı.', 941979936, 'Active', '(MAÇ SONUCU-ÖZET)', 'Ankaragücü Manisa FK 2-1 ', 1);
